import React from "react";
import "../style/_menu-composant.scss";
import Data from "./data";

class Tag extends React.Component {
  render() {
    return Data.map((el) => {
      return (
        <div className="tag-line">
          <div className="tag">{el.tags}</div>
        </div>
      );
    });
  }
}

export default Tag;
